import React from "react";

function Home() {
  return (
    <div className="home">
      <div>
        <img src="./images/logo.png" alt="logo" />
      </div>
      <button type="submit">Login</button>
      <button type="submit">Register</button>
    </div>
  );
}

export default Home;
